import React from 'react';

const Dashboard = () => {
  // You can define actions and state for this component here
  const handleAction = () => {
    console.log("Action clicked!");
  };

  return (
    <div>
      <h1>Dashboard</h1>
      <p>This is the dashboard page where users are redirected after logging in.</p>
      <button onClick={handleAction}>Click me</button>
    </div>
  );
};

export default Dashboard;
